package com.shawn.ss.tutorial.gc_about;

public class FinalizerProblem {
    public static final class ObjectWithStupidFinalizer{
        static String bigString="this is a long text , its size is over 16KB ;";
        String selfStr;
        public ObjectWithStupidFinalizer(int i) {
            this.selfStr = String.valueOf(i).concat(bigString);
        }

        @Override
        protected void finalize() throws Throwable {
            super.finalize();
            int i=0;
            while(i++<50){
                Thread.sleep(200);
                System.out.println("sleep in finalize function of thread:"+Thread.currentThread().getName());
            }
        }
    }

    public static final class ObjectWithoutStupidFinalizer{
        static String bigString="this is a long text , its size is over 16KB ;";
        String selfStr;
        public ObjectWithoutStupidFinalizer(int i) {
            this.selfStr = String.valueOf(i).concat(bigString);
        }

//        @Override
//        protected void finalize() throws Throwable {
//            super.finalize();
//            while(true){
//                Thread.sleep(100);
//            }
//        }
    }

    public static void testFinalizer(){
        for(int i=0;i<1000000;++i){
            ObjectWithStupidFinalizer so=new ObjectWithStupidFinalizer(i);
        }
    }

    public static void testFinalizerSafe(){
        for(int i=0;i<1000000;++i){
            ObjectWithoutStupidFinalizer so=new ObjectWithoutStupidFinalizer(i);
        }
    }
}
